import React from 'react'
import './Left.scss'

export default function Left() {
    return (
        <div className="TM_Left">
            <div className="card> bg-white">
                <div className="card-image text-center">
                    <img className="rounded-circle" src="https://images.pexels.com/photos/220453/pexels-photo-220453.jpeg?auto=compress&cs=tinysrgb&crop=faces&fit=crop&h=120&w=120" />
                </div>
            </div>
        </div>
    )
}
